import React, {Component} from 'react';
import './App.css';

const tasks = [
  {
    id: 1,
    title: ":)",
    description:":)=====D",
    completed:true
  },
  {
    id: 2,
    title: "Some thing",
    description:"Some thing x 2",
    completed:true
  },
  {
    id: 3,
    title: "Order Release",
    description:"Check out customers account and release or vlock ordes acordingly.",
    completed:true
  },
  {
    id: 4,
    title: "Weekly Reporst",
    description:"Sending the weekly reports for overdiw invoices",
    completed:true   
  },
]

class App extends Component{
  constructor(props){
    super(props);
    this.state={
      viewCompleted:false,
      taskList: tasks,

    };
  }

  displayCompleted = status => {
    if(status){
      return this.setstatus({viewCompleted:true});
    }
    return this.setstatus({viewCompleted:false});

  }

}


export default App;
